// Vertically Align
$.fn.vAlign = function() {
	return this.each(function(i){
	var ah = $(this).height();
	var ph = $(this).parent().height();
	var mh = Math.ceil((ph-ah) / 2);
	$(this).css('margin-top', mh);
	});
}

// Check Position
$.fn.checkPosition = function() {
	var pageWidth = 960;
	var offset = $(this).offset();
	var boxWidth = $(this).width();
	var rightLimit = ($(document).width() + pageWidth)/2;
	var rightPosition = offset.left+boxWidth;
	// console.log("rightLimit: " + rightLimit);
	// console.log("rightPosition: " + rightPosition);
	// var delta = rightPosition - rightLimit;
	// return delta;
	if (rightPosition > rightLimit) {
		$(this).addClass('pointer-right');
	}
}

